import React from 'react';
import './ResultsSection.css';
import { TriageState } from '../types/TriageTypes';

interface ResultsSectionProps {
  triageState: TriageState;
}

const ResultsSection: React.FC<ResultsSectionProps> = ({ triageState }) => {
  const getESIClass = (esi: string | null) => {
    if (!esi) return '';
    const level = esi.includes('level_') ? 
      Number(esi.split('_')[1]) : 
      Number(esi.split('-')[1]);
    return `esi-${level}`;
  };

  if (!triageState.triage) {
    return (
      <div className="results-section">
        <div className="no-results">
          <p>HenÃ¼z triage sonucu yok. LÃ¼tfen deÄerlendirmeyi tamamlayÄ±n.</p>
        </div>
      </div>
    );
  }

  return (
    <div className="results-section">
      <div className="results-container">
        <h3>Triage SonuÃ§larÄ±</h3>

        {/* Priority Status */}
        <div className="priority-section">
          <h4>Ãncelik Durumu</h4>
          <div className={`priority-badge ${getESIClass(triageState.triage.esi_level)}`}>
            <div className="priority-content">
              <span className="priority-level">
                {triageState.triage.esi_level || 'Belirlenmedi'}
              </span>
              <span className="priority-description">
                {triageState.triage.routing || 'YÃ¶nlendirme bilgisi yok'}
              </span>
            </div>
          </div>
        </div>

        {/* Critical Findings */}
        <div className="findings-section">
          <h4>Kritik Bulgular</h4>
          <div className="findings-content">
            {triageState.triage && triageState.triage.red_flags ? (
              (() => {
                const redFlags = triageState.triage.red_flags;
                let flagsList: string[] = [];

                if (Array.isArray(redFlags)) {
                  flagsList = redFlags;
                } else if (typeof redFlags === 'object') {
                  if (redFlags.primary) flagsList.push(...redFlags.primary);
                  if (redFlags.secondary) flagsList.push(...redFlags.secondary);
                  if (redFlags.vital_instability) flagsList.push(...redFlags.vital_instability);
                }

                return flagsList.length > 0 ? (
                  <ul className="findings-list">
                    {flagsList.map((item: string, index: number) => (
                      <li key={index} className="finding-item critical">
                        <svg width="16" height="16" viewBox="0 0 24 24" fill="none" xmlns="http://www.w3.org/2000/svg">
                          <path d="M10.29 3.86L1.82 18C1.64547 18.3024 1.5729 18.6453 1.61211 18.9874C1.65132 19.3295 1.8005 19.6507 2.03819 19.8991C2.27588 20.1475 2.59005 20.3108 2.93006 20.3653C3.27007 20.4198 3.61959 20.3626 3.92 20.2L12 16L20.08 20.2C20.3804 20.3626 20.7299 20.4198 21.0699 20.3653C21.4099 20.3108 21.7241 20.1475 21.9618 19.8991C22.1995 19.6507 22.3487 19.3295 22.3879 18.9874C22.4271 18.6453 22.3545 18.3024 22.18 18L13.71 3.86C13.5318 3.56631 13.2807 3.32312 12.9812 3.15447C12.6817 2.98582 12.3438 2.89725 12 2.89725C11.6562 2.89725 11.3183 2.98582 11.0188 3.15447C10.7193 3.32312 10.4682 3.56631 10.29 3.86Z" stroke="currentColor" strokeWidth="2" strokeLinecap="round" strokeLinejoin="round"/>
                        </svg>
                        {item}
                      </li>
                    ))}
                  </ul>
                ) : (
                  <div className="no-findings">Kritik bulgu tespit edilmedi</div>
                );
              })()
            ) : (
              <div className="no-findings">DeÄerlendirme tamamlanmadÄ±</div>
            )}
          </div>
        </div>

        {/* Immediate Actions */}
        <div className="actions-section">
          <h4>Acil Eylemler</h4>
          <div className="actions-content">
            {triageState.triage && triageState.triage.immediate_actions ? (
              (() => {
                const actions = triageState.triage.immediate_actions;
                let actionsList: string[] = [];

                if (Array.isArray(actions)) {
                  actionsList = actions;
                } else if (typeof actions === 'object') {
                  if (actions.primary) actionsList.push(...actions.primary);
                  if (actions.secondary) actionsList.push(...actions.secondary);
                  if (actions.vital_instability) actionsList.push(...actions.vital_instability);
                }

                return actionsList.length > 0 ? (
                  <ul className="actions-list">
                    {actionsList.map((item: string, index: number) => (
                      <li key={index} className="action-item">
                        <svg width="16" height="16" viewBox="0 0 24 24" fill="none" xmlns="http://www.w3.org/2000/svg">
                          <polyline points="9,18 15,12 9,6" stroke="currentColor" strokeWidth="2" strokeLinecap="round" strokeLinejoin="round"/>
                        </svg>
                        {item}
                      </li>
                    ))}
                  </ul>
                ) : (
                  <div className="no-actions">Acil eylem gerekmiyor</div>
                );
              })()
            ) : (
              <div className="no-actions">DeÄerlendirme tamamlanmadÄ±</div>
            )}
          </div>
        </div>

        {/* Follow-up Questions */}
        <div className="questions-section">
          <h4>Takip SorularÄ±</h4>
          <div className="questions-content">
            {triageState.triage && triageState.triage.questions_to_ask_next ? (
              (() => {
                const questions = triageState.triage.questions_to_ask_next;
                let questionsList: string[] = [];

                if (Array.isArray(questions)) {
                  questionsList = questions;
                } else if (typeof questions === 'object') {
                  if (questions.primary) questionsList.push(...questions.primary);
                  if (questions.secondary) questionsList.push(...questions.secondary);
                }

                return questionsList.length > 0 ? (
                  <ul className="questions-list">
                    {questionsList.map((question: string, index: number) => (
                      <li key={index} className="question-item">
                        <svg width="16" height="16" viewBox="0 0 24 24" fill="none" xmlns="http://www.w3.org/2000/svg">
                          <circle cx="12" cy="12" r="10" stroke="currentColor" strokeWidth="2"/>
                          <path d="M9,9a3,3 0 1,1 6,0c0,2-3,3-3,3" stroke="currentColor" strokeWidth="2" strokeLinecap="round" strokeLinejoin="round"/>
                          <path d="M12,17h.01" stroke="currentColor" strokeWidth="2" strokeLinecap="round" strokeLinejoin="round"/>
                        </svg>
                        {question}
                      </li>
                    ))}
                  </ul>
                ) : (
                  <div className="no-questions">Ek soru gerekmiyor</div>
                );
              })()
            ) : (
              <div className="no-questions">DeÄerlendirme tamamlanmadÄ±</div>
            )}
          </div>
        </div>
      </div>
    </div>
  );
};

export default ResultsSection;
